import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
// import "./app.css";
import { Provider } from "react-redux";

import { createStore } from "redux";

import NavBar from "./routes/Nav";
import { Typography, Divider } from "@material-ui/core";

import AuthRoute from "./routes/AuthRoute";

import LoginPage from "./routes/Login";

// import { appMiddleware } from "./routes/app";
// import { apiMiddleware } from "./routes/core";
import Interface from "./components/Interface";

// const createStoreWithMiddleware = applyMiddleware(
//   appMiddleware,
//   apiMiddleware
// )(createStore);

// const store = createStoreWithMiddleware(reducer);

const IndexPage = () => (
  <>
    <Typography variant="h3">Welcome to the App</Typography>
    <Divider style={{ marginTop: 10, marginBottom: 10 }} />
    <Typography variant="h6">Feel free to take a look around</Typography>
  </>
);

export default function App() {
  return (
      <Router>
        <NavBar />
        <div className="container">
          <Switch>
            <AuthRoute path="/home" render={Interface} type="private" />
            <AuthRoute path="/login" type="guest">
              <LoginPage />
            </AuthRoute>
            {/* <AuthRoute path="/my-account" type="private">
              <MyAccount />
            </AuthRoute>
            <Route path="/" render={IndexPage} /> */}
          </Switch>
        </div>
      </Router>
  );
}
